import React from 'react';
import HeroSection from '../../components/HeroSection/HeroSection';
import FeatureHighlight from '../../components/FeatureHighlight/FeatureHighlight';
import MysteryBox from '../../components/MysteryBoxSection/MysteryBoxSection'; // New Mystery Box Section
import Testimonials from '../../components/Testimonials/Testimonials';
import FooterCTA from '../../components/FooterCTA/FooterCTA';
import CTAButton from '../../components/CTAButton/CTAButton';
import backgroundVideo from '../../assets/videos/logovideo.mp4';

import SEO from '../../components/SEO/Seo'; // New component for SEO meta tags

const LandingPage = () => {
  return (
    <>
      <SEO title="TechSaaS Vision - Empowering Your Business" />
      <HeroSection
        title="Empower Your Business with TechSaaS Vision"
        subtitle="Innovative, Scalable, and Secure Solutions to Drive Your Success"
        backgroundVideo={backgroundVideo} // Use the video for impact
        ctaButton={<CTAButton text="Discover the Vision" link="#" />}
      />
      <MysteryBox /> {/* New Section */}
      <FeatureHighlight />
      <Testimonials />
      <FooterCTA text="Ready to take your business to the next level?" />
    </>
  );
};

export default LandingPage;
